import React from "react";

function ReportsPage() {
  return (
    <div style={{ padding: "1.5rem" }}>
      <h2>Reports / Earnings</h2>
      <p>We will build the earnings & expenses summary UI here later.</p>
    </div>
  );
}

export default ReportsPage;
